import React from "react";

function Cards(props) {
  return (
    <>
      <div className="card" /*full_container*/>
        <div className="view overlay" /*card_image*/>
          <img className="card-img-top" src={props.imgsrc} alt="image_pic"  />
          </div>

          <div /*Card_Content*/ className="card-body">
            <h4 className="card_title">{props.name}</h4>
            <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's
    content.</p>
            <a href={props.link} className ="btn btn-primary">
              More Info
            </a>
          </div>
        </div>
      
    </>
  );
}

export default Cards;
